import "../nav.css";
import "../images/profile";

function Navigation() {
   return (
      <div className="Navigation">
         <button>메뉴</button>
         <div className="title">Meonghamyo</div>
         <img src="profile.jpeg" className="profileImage">
            프로필
         </img>
      </div>
   );
}

export default Navigation;
